import React from "react";
import { NavLink } from "react-router-dom";
import {
  Button,
  Container,
  Dropdown,
  Image,
  Menu,
  Input,
  Icon,
  Label,
} from "semantic-ui-react";

const searchstyle = {
  width: "200px",
};

const mystyle = {
  // padding:"120px 20px 0px 260px",
  backgroundColor: "#800080",
};

export default function Navbar(props) {
  return (
    <div>
      <Menu inverted fixed="top" size="massive">
        <Menu.Item>
          <Image as={NavLink} to="/home" to=""src="images/naxus12.PNG" size="small" />
        </Menu.Item>

        <Menu.Menu position="right">
          <Menu.Item className="d-flex justify-content-end">
            <Input
              size="huge"
              className="icon"
              icon="search"
              placeholder="Searching?"
            />
          </Menu.Item>
          <Menu.Item>
            <Icon name="user outline" size="large" />
            <Dropdown item text="Account">
              <Dropdown.Menu>
                <Dropdown.Item>
                  <Button primary size="small" as={NavLink} to="/loginscreen" >
                    Login
                    <Icon name="sign in" />
                  </Button>
                </Dropdown.Item>
                <Dropdown.Item>
                  <Button primary size="small" as={NavLink} to="/signup">
                    Sign-up <Icon name="signup" />
                  </Button>
                </Dropdown.Item>
              </Dropdown.Menu>
            </Dropdown>
          </Menu.Item>
          <Menu.Item>
            <Button backgroundcolor="grey" inverted color="black" as={NavLink} to="/myfavorites">
              <Icon name="heart outline" />
              My Favorite
            </Button>
          </Menu.Item>
          <Menu.Item>
            <Button backgroundcolor="grey" inverted color="black" as={NavLink} to="/cart">
              <Icon name="shopping cart" />
              Cart
            </Button>
          </Menu.Item>
        </Menu.Menu>
      </Menu>
    </div>

    // <div style={divstyle}>
    //   <Menu inverted fixed="top">
    //     <Container>
    //       <Menu.Item name="editorials">Editorials</Menu.Item>
    //       <Menu.Item name="reviews">Reviews</Menu.Item>
    //       <Menu.Item name="upcomingEvents">Upcoming Events</Menu.Item>
    //       </Container>
    //   </Menu>
    // </div>
  );
}
